import React from 'react';
import {Link} from 'react-router-dom';

const Header = () => {

    return(
        <header>
            <div className="left-menu">
                <Link to="/">HOME</Link>
                <Link to="/">BOOK</Link>
                <Link to="/">E-BOOK</Link>
                <Link to="/">GOODS</Link>
                <Link to="/">BESTSELLER</Link>
            </div>

            <div className="right-menu">
                <Link to="/">LOGIN</Link>
                <Link to="/">JOIN</Link>
                <Link to="/">MYPAGE</Link>
                <Link to="/">CART</Link>
            </div>
        </header>

    );
};

export default Header;
